#include <stdio.h>
#include <string.h>
#include <assert.h>
char *input[] = {
"",
"",
"",
"",
"",
};

void process(char *str)
{
	char *shit[] = {
		"123",
		"456",
		"789",
		//{ '1', '2', '3', },
		//{ '4', '5', '6', },
		//{ '7', '8', '9', },
	};
	int xpos = 1, ypos = 1;

	for (int i = 0; i < strlen(str); i++) {
		if (str[i] == 'D') {
			if (ypos < 2) ypos++;
		} else if (str[i] == 'L') {
			if (xpos > 0) xpos--;
		} else if (str[i] == 'U') {
			if (ypos > 0) ypos--;
		} else if (str[i] == 'R') {
			if (xpos < 2) xpos++;
		} else {
			assert(0);
		}
	}
	printf("%c", shit[ypos][xpos]);
}

int main()
{

	for (int i = 0; i < 5; i++) process(input[i]);
	printf("\n");
	return 0;
}
